// src/pages/AnaliseDeDados.tsx
import React, { useEffect, useState } from 'react';
import { fetchAnaliseAcoes } from '../api';

const AnaliseDeDados: React.FC = () => {
    const [acoes, setAcoes] = useState<any[]>([]);

    useEffect(() => {
        const obterAcoes = async () => {
            try {
                const dadosAcoes = await fetchAnaliseAcoes();
                setAcoes(dadosAcoes);
            } catch (error) {
                console.error('Erro ao obter ações:', error);
            }
        };

        obterAcoes();
    }, []);

    return (
        <div>
            <h1>Análise de Dados em Ações</h1>
            <h2>Top 10 Ações do Ano</h2>
            <table>
                <thead>
                    <tr>
                        <th>Ação</th>
                        <th>Preço Atual</th>
                        <th>Crescimento (%)</th>
                    </tr>
                </thead>
                <tbody>
                    {acoes.length > 0 ? (
                        acoes.map((acao, index) => (
                            <tr key={index}>
                                <td>{acao.acao}</td>
                                <td>{acao.preco_atual.toFixed(2)}</td>
                                <td>{acao.crescimento_percentual.toFixed(2)}%</td>
                            </tr>
                        ))
                    ) : (
                        <tr>
                            <td colSpan={3}>Nenhum dado disponível</td>
                        </tr>
                    )}
                </tbody>
            </table>
        </div>
    );
};

export default AnaliseDeDados;
